import React from "react";
import { Routes, Route } from "react-router-dom"; // Import Routes and Route from react-router-dom
import Navigation from "./components/Navigation"; // Import Navigation component
import StreamList from "./components/StreamList"; // Import StreamList component
import Movies from "./pages/Movies"; // Import Movies page component
import Cart from "./pages/Cart"; // Import Cart page component
import About from "./pages/About"; // Import About page component
import Home from "./pages/Home"; // Import Home page component
import MovieSearch from "./pages/MovieSearch"; // Import MovieSearch page component
import "./styles/styles.css"; // Import global CSS

function App() {
  return (
    <div>
      <Navigation /> {/* Render the Navigation component */}
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/search" element={<MovieSearch />} />
        <Route path="/movies" element={<Movies />} />
        <Route path="/cart" element={<Cart />} />
        <Route path="/about" element={<About />} />
        <Route path="/streamlist" element={<StreamList />} />
      </Routes>
    </div>
  );
}

export default App;
